export function getSearchBarRequest(search, handleSurveyButton){
    console.log('getsearchbarrequest: ' + search);

    switch(search){
        case 'evaluate':
            console.log('Request Evaluation App');
            return;
        case 'survey':
            this.props.handleSurveyButton();
            return;
        default:
            console.log('Search bar request to default');
            return;
    }
}
